import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFileAlt, faMinus, faPlus, faSearch } from '@fortawesome/free-solid-svg-icons';
import { formatMoney, getCategoryIcon } from '../common/helpers';
import './TransactionsTable.css';

const TransactionsTable = ({ 
  transactions, 
  title, 
  showFilters = false, 
  searchTerm = '', 
  setSearchTerm = () => {}, 
  selectedCategory = 'all', 
  setSelectedCategory = () => {},
  expenseCategories = []
}) => {
  const [showTransactionForm, setShowTransactionForm] = useState(false);

  const filteredTransactions = showFilters 
    ? transactions.filter(transaction => {
        const matchesSearch = transaction.description.toLowerCase().includes(searchTerm.toLowerCase());
        const matchesCategory = selectedCategory === 'all' || transaction.category === selectedCategory;
        return matchesSearch && matchesCategory;
      })
    : transactions;

  return (
    <div className="transactions-container">
      <div className="transactions-header">
        <h3>{title}</h3>
        {showFilters && (
          <button 
            className="btn btn-primary"
            onClick={() => setShowTransactionForm(true)}
          >
            <FontAwesomeIcon icon={faPlus} /> Add Transaction
          </button>
        )}
      </div>

      {showFilters && (
        <div className="filters">
          <div className="search-box">
            <FontAwesomeIcon icon={faSearch} />
            <input 
              type="text" 
              placeholder="Search transactions..." 
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
          </div>
          
          <select 
            value={selectedCategory}
            onChange={(e) => setSelectedCategory(e.target.value)}
          >
            <option value="all">All Categories</option>
            {expenseCategories.map(category => (
              <option key={category.name} value={category.name}>
                {category.name.charAt(0).toUpperCase() + category.name.slice(1)}
              </option>
            ))}
          </select>
        </div>
      )}

      <div className="transactions-table">
        <table>
          <thead>
            <tr>
              <th>Date</th>
              <th>Description</th>
              <th>Category</th>
              <th>Amount</th>
              {showFilters && <th>Actions</th>}
            </tr>
          </thead>
          <tbody>
            {filteredTransactions.map((transaction) => (
              <tr key={transaction.id}>
                <td>{new Date(transaction.date).toLocaleDateString()}</td>
                <td>{transaction.description}</td>
                <td>
                  <span className="category-tag">
                    <FontAwesomeIcon icon={getCategoryIcon(transaction.category)} />
                    {transaction.category}
                  </span>
                </td>
                <td className={transaction.type === 'income' ? 'income' : 'expense'}>
                  {transaction.type === 'income' ? '+' : '-'}${formatMoney(Number(transaction.amount))}
                </td>
                {showFilters && (
                  <td>
                    <button className="btn-icon" title="View details">
                      <FontAwesomeIcon icon={faFileAlt} />
                    </button>
                    <button className="btn-icon" title="Delete">
                      <FontAwesomeIcon icon={faMinus} />
                    </button>
                  </td>
                )}
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {showTransactionForm && (
        <TransactionForm 
          onClose={() => setShowTransactionForm(false)}
          onTransactionAdded={() => window.location.reload()} // Refresh to show new transaction
        />
      )}
    </div>
  );
};

export default TransactionsTable;
